import './LeftSignup.css';
import img from '../Images/newyork.png'

function LeftSignup(){
    return(
        <div className="HomePageRightSide-Container"> 
            <div className="HomePageimage-card">
                <img src={img} alt="background"/>
            </div>
        </div>
    );
}

export default LeftSignup;
